import React from "react";
import "../../index.css";

const Login = () => {
  return (
      <section class="bg-kuning py-5">
        <div class="container py-5">
			<div class="row justify-content-center">
				<div class="col-md-12">
		          <form class="form">  
		          	<div class="title1">
		          		<p class="text-center">Mulai investasimu sekarang!</p>
		          	</div>
		          	<a href="/">
		          		<img src="images/logo/udana-logo-black.95aeeadd.png" alt=""/>
		          	</a>
		          </form>
				</div>
			</div>
        </div>
      </section>
    );
  };

export default Login;
